import React, {useState} from 'react';
import './Cuadrito.css';

function Cuadrito(props) {
    const [cuadritoColor, setCuadritoColor] = useState("white");

    return <div className="cuadrito" style={{backgroundColor : cuadritoColor}}></div>
}

export default Cuadrito ;
